import Layout from "../components/Layout";
import Head from "next/head";
function hola() {
  return (
    <>
      <Head>
        <title>FriFolly</title>
        <meta charset="utf-8" />
        <meta
          name="viewport"
          content="width=device-width,height=device-height,initial-scale=1,maximum-scale=1"
        />
        <meta name="format-detection" content="telephone=no"></meta>
        <meta name="theme-color" content="#2775FF"></meta>
        <meta name="keywords" content="themeforest, theme, html, template" />
        <meta name="description" content="themeforest, theme, html, template" />
      </Head>
      <div className="brk-loader">
        <div className="brk-loader__loader"></div>
      </div>
      {/* // <div id="page">
    //   <Layout></Layout>;
    // </div> */}
      <style jsx>{`
        .brk-loader {
          position: fixed;
          top: 0;
          left: 0;
          width: 100%;
          height: 100%;
          background-color: #fff;
          z-index: 99999;
          transition: all 0.3s;
        }
        .brk-loader-remove {
          opacity: 0;
          visibility: hidden;
        }
        .brk-loader__loader {
          display: block;
          position: relative;
          left: 50%;
          top: 50%;
          width: 150px;
          height: 150px;
          margin: -75px 0 0 -75px;
          border-radius: 50%;
          border: 3px solid transparent;
          border-top-color: #2775ff;
          -webkit-animation: spin 2s linear infinite;
          animation: spin 2s linear infinite;
        }
        .brk-loader__loader:after,
        .brk-loader__loader:before {
          content: "";
          position: absolute;
          border-radius: 50%;
          border: 3px solid transparent;
        }
        .brk-loader__loader:before {
          top: 5px;
          left: 5px;
          right: 5px;
          bottom: 5px;
          border-top-color: #7202bb;
          -webkit-animation: spin 3s linear infinite;
          animation: spin 3s linear infinite;
        }
        .brk-loader__loader:after {
          top: 15px;
          left: 15px;
          right: 15px;
          bottom: 15px;
          border-top-color: #b50aff;
          -webkit-animation: spin 1.5s linear infinite;
          animation: spin 1.5s linear infinite;
        }
      `}</style>
    </>
  );
}

export default hola;
